         .layui-tab {

         }

         .layui-tab-content {

         }

         .ico-list .mdi {
              margin: 5px ;
              padding: 5px;
              cursor:pointer;
              font-size: 26px;
              width: 30px;
              border-radius: 3px;
              text-align: center;
              color: #363f45;
         }

         .ico-list .mdi:hover {
              background-color: #1d9d74;
              color: #ffffff;
         }

         .ico-list {
              display: -webkit-flex; /* Safari */
              display: flex;
              flex-direction:row;
              flex-wrap:wrap;
              align-items:start;
              justify-content: flex-start;
         }

        .ico-list .fa{
            margin: 5px;
            padding: 5px;
            cursor:pointer;
            font-size: 21px;
            width: 25px;
            border-radius: 3px;
            text-align: center;
             color: #363f45;
        }
        .ico-list .fa:hover {
            background-color: #1d9d74;
            color: #ffffff;
        }

        .icon_container {
          overflow-y : scroll;
        }

        body{
             -webkit-user-select:none;
             -moz-user-select:none;
             -ms-user-select:none;
             user-select:none;
        }

        .icon-css-div {
             -webkit-user-select: all;
             -moz-user-select: all;
             -ms-user-select: all;
             user-select: all;
        }

    </style>

               <div style="width: 200px;padding-top: 12px;padding-left: 12px;" id="icon-css" class="icon-css-div"></div>
          </div>
          <div style="float: right">
               <button type="button" id="sure" class="layui-btn layui-btn-normal"> 确定 </button>
               <button type="button" id="cancel" class="layui-btn layui-btn-primary" style="margin-right:16px"> 取消 </button>
          </div>
</div>
<script>

layui.use('element', function(){
     // var body=$("body");
     // var bodyHeight=body.height();
     // $(".icon_container").height((bodyHeight-250)+"px");

});

var callback=null;
var iconClass=null;
window.setLinkIn=function(id,cb){
     callback=cb;
}
$(document).ready(function(){
     var fullHeight=$(window).height();
     $(".icon_container").height(fullHeight-116);
     $("#sure").click(function(){
         callback("sure",iconClass);
     });

     $("#cancel").click(function(){
          callback("cancel",iconClass);
     });

     $("i").click(function(){
         $("i").css("background-color","");
         $("i").css("color","#363f45");
         $(this).css("background-color","#1d9d74");
         $(this).css("color","#ffffff");
         iconClass=$(this).attr("class")
         console.log("class",iconClass);
         // var tmp=iconClass.split(" ");
         $("#icon-css").text(iconClass);
     });

    $("i").dblclick(function(){
        callback("sure",iconClass);
    });

    function searchIcon(css,kw) {
         var els=$(css);
         if(!kw || kw=="") {
              els.show();
              return;
         }
         for (var i = 0; i < els.length; i++) {
              var el=$(els[i]);
              var css=el.attr("class");
              if(css.indexOf(kw)==-1) {
                   el.hide();
              } else {
                   el.show();
              }
         }
    }

     $(".search-input").keydown(function(event) {
          if(event.keyCode !=13) return;
          var kw=$(".search-input").val();

          searchIcon(".fa",kw);
          searchIcon(".mdi",kw);
     });

});

</script>
